import { Avatar } from "@material-ui/core";

import {
    AppsOutlined,
    Menu,
    Mic,
    NotificationsNoneOutlined,
    SearchOutlined,
    VideoCallOutlined,
} from "@material-ui/icons";
import { useState } from "react";
import "./header.css";

const Header = () => {
    const [anchorEl, setAnchorEl] = useState(null);
    const open = Boolean(anchorEl);
    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };
    const handleClose = () => {
        setAnchorEl(null);
    };
    return (
        <div className="header">
            <div className="header__wrapper">
                <div className="header__left">
                    <Menu className="header__icons" />
                    <img
                        src="https://upload.wikimedia.org/wikipedia/commons/thumb/b/b8/YouTube_Logo_2017.svg/300px-YouTube_Logo_2017.svg.png"
                        alt=""
                        className="header__img"
                    />
                </div>
                <div className="header__center">
                    <div className="header__center-wrapper">
                        <input
                            type="text"
                            placeholder="Tìm kiếm"
                            className="header__input"
                        />
                        <SearchOutlined className="header__search" />
                    </div>
                    <Mic className="header__icons-mic" />
                </div>
                <div className="header__right">
                    <VideoCallOutlined className="header__icons" />

                    {/* <Brightness4Outlined className="header__icons" /> */}
                    <AppsOutlined className="header__icons" />
                    <NotificationsNoneOutlined className="header__icons" />

                    <Avatar
                        id="basic-avatar"
                        aria-controls={open ? "basic-menu" : undefined}
                        aria-haspopup="true"
                        aria-expanded={open ? "true" : undefined}
                        onClick={handleClick}
                        className="header__icons avatar"
                    />
                </div>
            </div>
        </div>
    );
};

export default Header;
